import React from "react";

const Report = () => {
  return (
    <div>
      {/* <h1>Financial Report Form</h1> */}
      <form action="">
        <label htmlFor="offer"> Offer on the Mass Service </label>
        <input type="text" name="offer" id="offer" placeholder="Offer" />

        <label htmlFor="five"> Monthly Members Donation </label>
        <input
          type="number"
          name="five"
          id="five"
          placeholder="Members payment"
        />

        <label htmlFor="fire-kidasie"> Mass Service Payment </label>
        <input
          type="text"
          name="fire-kidasie"
          id="fire-kidasie"
          placeholder="Mass Service Payment"
        />

        <label htmlFor="date"> Service Date </label>
        <input type="date" name="date" id="date" placeholder="Service Date" />

        <button> Submit </button>
      </form>

